import NavBar from './Components/Navbar'
import StayUpdated from './Components/StayUpdated'
import './Style/Newsletter.css';

const GoogleForm = () => {
  return (
    <div style={{ width: "100%", height: "100%", display: "flex", justifyContent: "center", alignItems: "center" }}>
      <iframe
        src="https://docs.google.com/forms/d/e/1FAIpQLSfMojNlZnhz0PJiC3SX7D-k7btD3ow4uSeRFfM6cvPjtxXRag/viewform?embedded=true"
        width="100%"
        height="600"
        style={{ border: "none" }}
        title="Google Form"
        allowFullScreen
      >
        Loadingâ€¦
      </iframe>
    </div>
  );
};

function Newsletter() {
  return (
    <div className="Newsletter">
      <NavBar></NavBar>
      <div className="NewsletterHeading">
        <h1> Join Our Newstter </h1>
      </div>
      <p>Fill out the form below to be added to our newsletter to get updates on future events!</p>
      <GoogleForm />
      <StayUpdated></StayUpdated>
    </div>
  );
}

export default Newsletter;
